    const nav = useRef(null);
    const closeNav = () => {
      nav.current.style.display = "none";
    };

    // const [navOpen, setNavOpen] = useState(false);

    // const toggleNav = () => {
    //   setNavOpen(!navOpen);
    // };
return(
    <header>
        <h3>Logo</h3>
        <nav ref={nav}>
            <button onClick={closeNav} className="nav-btn nav-close-btn"><FaTimes/></button>
            <button className="login">Login</button>
            <button className="signup">Signup</button>
        </nav>
        <button onClick={() => {toggleNav();}} className="nav-btn nav-close-btn"><FaBars/></button>
    </header>
)
}

export default Navbar;
